import React, { useState } from 'react';
import { FaBars } from 'react-icons/fa';
import './CategoryBar.css';

const CategoryBar = () => {
    return (
        <div className='category-bar'>
            <FaBars size={40} />
            <h1>한식</h1>
            <h1>중식</h1>
            <h1>일식</h1>
            <h1>양식</h1>
            <h1>카페 / 디저트</h1>
        </div>
    )
}
export default CategoryBar;
